description:
This one is a lot of fun. It&amp;#039;s a full length book of Stan Lee exposing, and poking fun at, Marvel&amp;#039;s biggest mistakes over the years. Typos, misspellings, two left hands, looking through the periscope with the eye that has the patch over it, misnamed characters, incoherent story lines... if Marvel Comics was a video, this would be the blooper reel.

This is a cover to cover scan and they&amp;#039;re all nice quality and about 1000 pixels wide.
